import React, { useState } from 'react';

function Twoandtwo() {
  const [showDiv2, setShowDiv2] = useState(true);
  const [showDiv3, setShowDiv3] = useState(false);

  const handleClick = () => {
    setShowDiv2(false);
    setShowDiv3(true);
  };

  return (
    <div className="1">
      {showDiv2 && (
        <div className="2" onClick={handleClick}>
          Div 2
        </div>
      )}
      {showDiv3 && <div className="3">Div 3</div>}
    </div>
  );
}

export default Twoandtwo;
